import React, { useState } from "react";
import { useForm } from "react-hook-form";
import "./styles.css";
const Cadastro = () => {
  const {
    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const [hasComorbidities, setHasComorbidities] = useState(false);

  const onSubmit = (data) => {
    console.log(data);
    // Aqui você pode adicionar a lógica de registro, por exemplo, chamar uma API
  };

  return (
    <div className="register-container">
      <h2>Cadastro</h2>
      <form onSubmit={handleSubmit(onSubmit)}>
        <div>
          <label htmlFor="nome">Nome Completo</label>
          <input
            id="nome"
            {...register("nome", { required: "Nome completo é obrigatório" })}
          />
          {errors.nome && <p>{errors.nome.message}</p>}
        </div>

        <div>
          <label htmlFor="cpf">CPF</label>
          <input
            id="cpf"
            {...register("cpf", {
              required: "CPF é obrigatório",
              pattern: {
                value: /^\d{3}\.\d{3}\.\d{3}-\d{2}$/,
                message: "Formato de CPF inválido",
              },
            })}
          />
          {errors.cpf && <p>{errors.cpf.message}</p>}
        </div>

        <div>
          <label htmlFor="password">Senha</label>
          <input
            type="password"
            id="password"
            {...register("password", { required: "Senha é obrigatória" })}
          />
          {errors.password && <p>{errors.password.message}</p>}
        </div>

        <div>
          <label htmlFor="idade">Idade</label>
          <input
            type="number"
            id="idade"
            {...register("idade", { required: "Idade é obrigatória" })}
          />
          {errors.idade && <p>{errors.idade.message}</p>}
        </div>

        <div>
          <label htmlFor="endereco">Endereço</label>
          <input
            id="endereco"
            {...register("endereco", { required: "Endereço é obrigatório" })}
          />
          {errors.endereco && <p>{errors.endereco.message}</p>}
        </div>

        <div>
          <label htmlFor="dataNascimento">Data de Nascimento</label>
          <input
            type="date"
            id="dataNascimento"
            {...register("dataNascimento", {
              required: "Data de nascimento é obrigatória",
            })}
          />
          {errors.dataNascimento && <p>{errors.dataNascimento.message}</p>}
        </div>

        <div>
          <label htmlFor="estadoOrigem">Estado de Origem</label>
          <input
            id="estadoOrigem"
            {...register("estadoOrigem", {
              required: "Estado de origem é obrigatório",
            })}
          />
          {errors.estadoOrigem && <p>{errors.estadoOrigem.message}</p>}
        </div>

        <div>
          <label htmlFor="cidade">Cidade</label>
          <input
            id="cidade"
            {...register("cidade", { required: "Cidade é obrigatória" })}
          />
          {errors.cidade && <p>{errors.cidade.message}</p>}
        </div>

        <div>
          <label>Possui comorbidades?</label>
          <div>
            <input
              type="radio"
              id="comorbidadesSim"
              value="yes"
              {...register("comorbidades", {
                required: "Por favor, selecione uma opção",
              })}
              onChange={() => setHasComorbidities(true)}
            />
            <label htmlFor="comorbidadesSim">Sim</label>
          </div>
          <div>
            <input
              type="radio"
              id="comorbidadesNao"
              value="no"
              {...register("comorbidades", {
                required: "Por favor, selecione uma opção",
              })}
              onChange={() => setHasComorbidities(false)}
            />
            <label htmlFor="comorbidadesNao">Não</label>
          </div>
          {errors.comorbidades && <p>{errors.comorbidades.message}</p>}
        </div>

        {hasComorbidities && (
          <div>
            <label htmlFor="quaisComorbidades">Quais comorbidades?</label>
            <textarea
              id="quaisComorbidades"
              {...register("quaisComorbidades", {
                required: "Por favor, descreva suas comorbidades",
              })}
            />
            {errors.quaisComorbidades && (
              <p>{errors.quaisComorbidades.message}</p>
            )}
          </div>
        )}

        <button type="submit">Registrar</button>
      </form>
    </div>
  );
};

export default Cadastro;
